async function generateKey(key) {
    const enc = new TextEncoder();
    let keyData = enc.encode(key); // 기본적으로 키를 UTF-8로 인코딩
    // 키를 128비트(16바이트) 또는 256비트(32바이트)로 맞추기
    keyData = keyData.slice(0, 32); // 최대 32바이트 (256비트로 맞추기)
    if (keyData.length < 32) {
        // 키 길이가 32바이트 미만이면 패딩을 추가
        keyData = new Uint8Array(32);
        keyData.set(enc.encode(key));
    }
    const cryptoKey = await window.crypto.subtle.importKey(
        "raw", 
        keyData, 
        { name: "AES-GCM" }, 
        false, 
        ["encrypt", "decrypt"]
    );
    return cryptoKey;
}

async function decrypts(key, encryptedDataStr, ivStr) {
    // encryptedDataStr과 ivStr을 쉼표로 분리하여 Uint8Array로 변환
    const encryptedData = new Uint8Array(encryptedDataStr.split(',').map(Number));
    const iv = new Uint8Array(ivStr.split(',').map(Number));

    const cryptoKey = await generateKey(key);

    const decryptedData = await window.crypto.subtle.decrypt(
        { name: "AES-GCM", iv: iv },
        cryptoKey,
        encryptedData
    );

    const dec = new TextDecoder();
    return dec.decode(decryptedData); // 복호화된 텍스트 반환
}

const key = "data:image/png;base64,";

const encryptedDatas = "163,41,116,134,120,210,224,183,41,132,63,91,54,92,66,91,77,15,212,57,160,210,36,119,68,43,42,167,144,67,133,187,54,108,75,159,108,6,214,227,6,4,207,186,140,222,235,239,194,38,22,14,113,252,239,181,114,30,218,54,235,250,162,176,175,238,158,156,13,190,161,148,90";  // 암호화된 데이터
const ivs = "24,54,151,61,156,38,128,67,238,97,32,68";  // iv 값
let score = 0;  // score 변수 초기화 (0으로 설정)
const datas = {
    score: score,   // score 변수를 datas 객체 안에 포함
    message: ""     // 초기값으로 빈 문자열 할당
};
// 복호화 함수
async function serversenddataclear() {
    try {
        const decryptedDatadoll = await decrypts(key, encryptedDatas, ivs);  // 복호화된 데이터
        datas.message = decryptedDatadoll;  // 복호화된 데이터를 datas.message에 저장
        sendDataToServer();  // 서버로 데이터 전송 함수 호출
    } catch (error) {
        console.error("복호화 실패:", error);
    }
}

// 서버로 데이터 전송
function sendDataToServer() {
    $.ajax({
        url: '/update_score',  // 요청할 URL
        type: 'POST',  // HTTP 요청 방식
        contentType: 'application/json',  // 요청 본문이 JSON 형식임을 명시
        data: JSON.stringify(datas),  // 데이터를 JSON으로 변환하여 보냄
        success: function(result) {  // 서버로부터 응답이 오면 실행될 함수
            if (result.success) {
                console.log('Score updated successfully: ', result.score);
            } else {
                console.log('Failed to update score:', result.message);
            }
        },
        error: function(xhr, status, error) {  // 요청이 실패했을 때 실행될 함수
            console.error('Error updating score:', error);
        }
    });
}

